export const getAlerts = () => {
	return (dispatch) => {
		fetch("http://localhost:3001/alerts")
			.then((res) => res.json())
			.then((JSON) => {
				console.log(JSON);
				dispatch({ type: "SET_ALERTS", alerts: JSON });
			});
	};
};
